099";}i:105;a:1:{s:10:"short_code";s:11:"CEupFiqAcUj";}i:106;a:1:{s:12:"created_time";i:1599252908;}i:107;a:1:{s:7:"caption";s:1642:"Purple period 4 of 6. I think there is no equivalent word to serendipity in Portuguese. "Acaso" (fate or chance) doesn't embrace it's whole meaning. "Acaso" doesn't have to be necessarily beneficial or happy. "Acaso" is more common, serendipity is rare. I've been only once to Italy, by chance (that eventually turned into serendipity). A bunch of years ago I made an Italian friend while studying in Munich. Anna is cheery, always carries I smile with her, but above all she's generous. Anna travels the world during the summer going to exotic and full-of-meaning places and delivers spot on quotes on Facebook. Couple of years later I was in Nuremberg (heading north to Berlin, if I'm not mistaken) and told her I was in Germany. I have just finished mentioning it as she invited me South, to her little town alongside Lago di Garda. I had no plans going to Italy, I was in a sort of tight schedule and even tighter budget. She insisted and invited me to stay at the hotel she works (for free). So I went. Two trains and a van ride later I arrived in Limone Sul Garda, one of the most picturesque places I've been to, where I spent a couple of marvelous days sipping Aperol Sprits in summery nights by the largest lake in Italy. "Acaso" is more common, this was a bit of so-not-often case of serendipity, and I'm thankful for it. :)

